window.bookSummaryJSON = "<p><b>The time has come for me to stand strong and take back what was meant to be mine. </b></p> <p>My entire life, I was groomed to be the perfect leader for my pack, but the day they were slaughtered changed everything. I search for answers, desperate for retribution, but every secret I uncover makes me challenge everything I’ve ever known. </p> <p>With my fated mate by my side, we face down the enemy, determined to give them a name and a face. </p> <p>What we discover is worse than we imagined. Things aren’t what they seem, and we might not recognize each other when it's all over.</p>"; 
